import React from "react";
import { useNavigate } from "react-router-dom";
import Products from "./Products";
import Categories from "./Categories";
import ProductCard from "../components/ProductCard";

export default function Home() {
  const navigate = useNavigate();
  return (
    <div>
      <div className="hero-container">
        <div className="hero-overlay">
          <h1 className="hero-title">Customize Your Perfect Cake</h1>
          <p className="hero-subtitle">Freshly baked cakes, pastries, waffles & more!</p>
          <button className="hero-btn" onClick={() => navigate("/category/custom-cakes")}>Start Customizing</button>
        </div>
      </div>
      <ProductCard/>
      <Categories />
    </div>
  );
}
